import logo from './img/logo.png';
import './App.css';
import React from 'react';

class App extends React.Component {
  constructor() {
    this.state = {date: new Date()};
  }
  render() {
    return (
      <div className="parent">
        <div className="entry">
          <div className="bar">
            <div className="logodiv">
              <img className="logo" src={logo}/>
              <div className="link">Email</div>
              <div className="link">LinkedIn</div>
              <div className="link">Github</div>
            </div>
            <div>
              <span className="date">{this.date.month}/{this.date.date}/{this.date.year}</span>
              <span className="time">
              {this.date.hours > 12 ? this.date.hours - 12 : this.date.hours}:{this.date.minutes} {this.date.hours > 12 ? "PM" : "AM"}
              </span>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
